import { FaShoppingCart } from "react-icons/fa";
import { NavLink } from "react-router-dom";
const Navbar = () => {
  return (
   <div className="flex items-center justify-between">
      <NavLink to="/">
       <div>
           <img src="https://help4code.com/static/images/logo.png"  width={120}/>
       </div>
      </NavLink>
    
      <div>
         <NavLink to="/">
            <p>Home</p>
          </NavLink>
          <NavLink to="/">
           <FaShoppingCart />
          </NavLink>
      
        </div>
    </div>);
};

export default Navbar;
